using Android.App;
using Android.Widget;
using Android.OS;
using Android.Graphics;
using Java.IO;
using System.IO;
using Android.Graphics.Drawables;

namespace BytesToImageDemo
{
    [Activity(Label = "BytesToImageDemo", MainLauncher = true, Icon = "@drawable/icon")]
    public class MainActivity : Activity
    {

        Button bt;
        ImageView imgV1;
        //The string is download form server in the json file
        string myBytes = "";
        protected override void OnCreate(Bundle bundle)
        {
            base.OnCreate(bundle);
            SetContentView(Resource.Layout.Main);
            bt = (Button)FindViewById<Button>(Resource.Id.button1);
            imgV1 = FindViewById<ImageView>(Resource.Id.imageView1);
            bt.Click += Bt_Click;
        }

        private void Bt_Click(object sender, System.EventArgs e)
        {
            //Bitmap bmp = BitmapFactory.DecodeResource(Resources, Resource.Drawable.Icon);
            //byte[] imgBytes = Bitmap2Bytes(bmp);
            //string result = System.Convert.ToBase64String(imgBytes);
            //System.Diagnostics.Debug.WriteLine("Mike Image byte===>" + result);
            byte[] decByte3 = System.Convert.FromBase64String(myBytes);
            Bitmap myIcon = Bytes2Bimap(decByte3);
            Drawable myIconD = new BitmapDrawable(myIcon);
            imgV1.Background = myIconD;
        }

        public byte[] Bitmap2Bytes(Bitmap bm)
        {
            MemoryStream ms = new MemoryStream();
            bm.Compress(Bitmap.CompressFormat.Png, 100, ms);
            return ms.ToArray();
        }

        public Bitmap Bytes2Bimap(byte[] b)
        {
            if (b.Length != 0)
            {
                return BitmapFactory.DecodeByteArray(b, 0, b.Length);
            }
            else
            {
              return null;
            }
        }
    }
}

